CREATE DEFINER=`root`@`%` PROCEDURE `sp_produce_leapid`(IN `_batch_id` int, IN  `_batch_count` int, OUT `_return_code` int,  OUT `_return_message` varchar(128))
BEGIN
	declare _reserved varchar(16);
	declare _key_main varchar(256);
	declare _key_ext varchar(1728);
	declare _batch_serial int default 0; -- 流水 1-999999
	declare _create_ts int;

  -- 开启事务
	START TRANSACTION;
    while _batch_serial < _batch_count do
		set _batch_serial=_batch_serial+1;

		BEGIN
			declare continue handler for sqlexception, sqlwarning, not found set _batch_serial=_batch_serial-1;
			set _reserved=rand_key(8);
			set _key_main=rand_key(128);
			set _key_ext=rand_key(864);
            set _create_ts = unix_timestamp(now());

			insert into `leapid`(`reserved`, `key_update`, `key_main`, `key_ext`, `batch_id`, `batch_serial`, `create_ts`)
            VALUE(_reserved, _key_update, _key_main, _key_ext, _batch_id, _batch_serial, _create_ts);
        END;
    end while;

    if _batch_serial = _batch_count then
		COMMIT;
		set _return_code = 1;
        set _return_message = concat('生成任务完成: 已生成到的流水号:', _batch_serial);
	else
		ROLLBACK;
		set _return_code = -1;
		set _return_message = concat('生成任务失败,请调试: 已生成到的流水号:', _batch_serial);
	end if;

END



CREATE DEFINER=`root`@`%` PROCEDURE `sp_produce_leapid`(IN `_batch_id` int, IN  `_batch_count` int, OUT `_return_code` int,  OUT `_return_message` varchar(128))
BEGIN
	declare _reserved varchar(16);
	declare _key_main varchar(256);
	declare _key_ext varchar(1728);
	declare _batch_serial int default 0; -- 流水 1-999999
	declare _create_ts int;

    declare _once_insert_total int;   -- 每次批量插入数量
    declare _once_insert_index int;   -- 每次批量插入记录索引
    declare _spt char(1) default ''; -- 分隔符


    set _once_insert_total =  1000;
    set _once_insert_index = 1;
    set @_sql = "insert into `leapid`(`reserved`, `key_main`, `key_ext`, `batch_id`, `batch_serial`, `create_ts`) VALUES ";

	-- 开启事务
	START TRANSACTION;

		while  _batch_serial < _batch_count do
            set _batch_serial=_batch_serial+1;

			BEGIN
				declare continue handler for sqlexception, sqlwarning, not found
				begin
					set _batch_serial=_batch_serial - _once_insert_index;
                    set @_sql = "insert into `leapid`(`reserved`, `key_main`, `key_ext`, `batch_id`, `batch_serial`, `create_ts`) VALUES ";
                    set _spt = '';
				end;

				set _reserved=rand_key(8);
				set _key_main=rand_key(128);
				set _key_ext=rand_key(864);
				set _create_ts = unix_timestamp(now());

				set @_sql = concat(@_sql, _spt, "('", _reserved, "', '", _key_main, "', '",_key_ext, "', ",_batch_id, ", ",_batch_serial, ", ",_create_ts ,")");

                set _spt = ',';

                if _once_insert_index >= _once_insert_total or _batch_serial >= _batch_count then
					prepare stmt from @_sql; 	-- 预处理动态sql语句
					execute stmt;  -- 运行 sql
                    deallocate prepare stmt;      -- 释放prepare

                    set @_sql = "insert into `leapid`(`reserved`, `key_main`, `key_ext`, `batch_id`, `batch_serial`, `create_ts`) VALUES ";  -- sql 重置
                    set _spt = '';    -- 分隔符重置
                    set _once_insert_index = 0;  -- 索引重置
                end if;

                set _once_insert_index = _once_insert_index+1;

			END;
		end while;

    if _batch_serial = _batch_count then
		COMMIT;
		set _return_code = 1;
        set _return_message = concat('生成任务完成: 已生成到的流水号:', _batch_serial);
	else
		ROLLBACK;
		set _return_code = -1;
		set _return_message = concat('生成任务失败,请调试: 已生成到的流水号:', _batch_serial);
	end if;

END

